import Link from 'next/link'
import Index from '../pages'
import styled from 'styled-components'

const NavContainer = styled.nav`
    background: #333;
    color: #eee;
    padding: .5em;
    border: 0em;
    margin: 0em;
    display: flex;
`;

const Nav = () => (
    <NavContainer>
        bruh moment
    </ NavContainer>
);

export default Nav;
